Для Каждого Строка Из Результат Цикл

	EDIINTERCHANGEID = НовыйНомерТранзакции(EDIINTERCHANGEID);

	Строка.DATE = Формат(Строка.ФайлДата, "ДФ=yyyy-MM-dd");
	Строка.DATEFROM = Формат(Строка.ДействуетС, "ДФ=yyyy-MM-dd");
	Строка.DATETO   = Формат(Строка.ДействуетПо, "ДФ=yyyy-MM-dd");
	Строка.EDIINTERCHANGEID = Формат(EDIINTERCHANGEID, "ЧГ=0");
	СлучайноеЧисло = ГСЧ.СлучайноеЧисло(100, 999);
	EDIMESSAGE = Формат(ТекущаяДата(), "ДФ=ггггММддЧЧммсс") + СлучайноеЧисло + "-OUT-" + Строка.EDIINTERCHANGEID;
	Строка.ФайлИмя = ФайлИмя + "_" + EDIMESSAGE + ".xml";
	Строка.Идентификатор = Строка.ВидДокумента + "_" + EDIMESSAGE;
	Строка.TIMEFROM = Формат(Строка.ДействуетС, "ДФ=HH:mm");
	Строка.TIMETO   = Формат(Строка.ДействуетПо, "ДФ=HH:mm");

	Если НЕ ЗначениеЗаполнено(Строка.CURRENCY) Тогда
	     Строка.CURRENCY = ПолучитьСтрокуВалютыДокумента(Строка.ВалютаНаименование);	
	КонецЕсли;
КонецЦикла;

Возврат Результат;
